import React from 'react'
// import  from '../components/assets/2.jpg';
import './HeroStyles.css'

function Hero(props) {
  return (
    <div className={props.cName}>
    <img src={props.heroImg} alt="heroImg" />
    <div className="hero-text">
    <h1>{props.title}</h1>
    <p>{props.text}</p>
    <a href={props.url} className={props.btn}>Travel Plan</a>
    </div>
    </div>
  )
}

export default Hero
